DROP TABLE IF EXISTS `ncog_score`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `ncog_score` (
  `ID` varchar(50) NOT NULL,
  `TYPELISTID` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '问卷id',
  `RESULT` double(10,2) DEFAULT NULL COMMENT '得分',
  `SFJF` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '是否统计分数到总分',
  `DTTH` int DEFAULT NULL COMMENT '大题题号',
  `XTTH` int DEFAULT NULL COMMENT '小题题号',
  `ANSWER` varchar(600) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '选择的答案',
  `GXRQ` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '更新日期',
  `PIC` text CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '画图',
  `SJFX1` float(10,0) DEFAULT NULL COMMENT '数据分析结果1 数值   第一题记忆用时                    第三题 角度1 ',
  `SJFX2` float(10,0) DEFAULT NULL COMMENT '数据分析结果2 数值   第一题存总时间  第五题存点击次数 第三题角度2',
  `SJFX3` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '数据分析结果3 字符型  所有小题作答时间',
  `SJFX4` float(10,2) DEFAULT NULL COMMENT '数据分析结果2 数值                  第五题 平均反应时间',
  `SJFX5` varchar(4000) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '数据分析结果3 字符型,正方体连线坐标#得分档位',
  `PICURL` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '图片地址',
  `LANGUAGE` varchar(5) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '快筛 每题存语言 （0:普通话，1：福清话）',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='问卷得分';
