CREATE TABLE `ncog_type_data_config` (
  `ID` varchar(50) NOT NULL,
  `USERID` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '用户id',
  `BUSINESS_PRIVACY` varchar(5) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '业务隐私设置',
