  `GXRQ` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '结束时间',
  `PIC` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '图片',
  `PRINT` int DEFAULT NULL COMMENT '打印次数',
  `PRINTALL` int DEFAULT NULL COMMENT '批量打印次数',
  `ORDERID` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '互联网医院的订单号',
