  `CONCLUSION` varchar(250) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '结论文本说明',
  `PERCENTAGE` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT 'ai结果百分比',
  `AI` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT 'ai结果 0表示只做了抑郁,没有结论,1表示结论是正常,3表示AI得出的疑似认知障碍,2表示截断值得出的意识认知障碍',
