  `IMPORTED` varchar(5) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '0导入的数据 1导出的数据',
  `DCCG` varchar(5) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '0导出失败1导出成功',
  `DCDZ` varchar(300) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '导出地址',
  `EDITION` varchar(5) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '1低配 0高配',
  `EDUCATION` varchar(5) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '教育水平  1：未知；2：小学；3：初中；4：中专；5：高中；6：专科；7：本科；8：硕士；9:博士及以上;10:未上过学；11：小学3年或3年以下；12：小学3年以上。\n传受教育情况，例如小学3年以上，education=12',
  `YYURL` varchar(300) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '来源地址',
  `ORIGIN` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '数据来源',
  `INFACT` varchar(5) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '代做影响后的推送状态  1疑似代做未推送  0 一般未推送  2代做一推送  3非代做推送',
