  `JUDGEMOD_CONVERT_SCORE` float DEFAULT NULL COMMENT '截断值分数转换分',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='问卷总表';
